import React, { useEffect, useState } from "react";

export function useData(url) {
    const [data, setData] = useState([]);
    const [error, setError] = useState('');
    useEffect(() => {
        fetch(url)
            .then(response => response.json())
            .then(data => setData(data));

    }, []);
    console.log(data);

    return data;
}

export default useData;
